// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "contracts/BaseERC20.sol";

interface IERC20{
    function balanceOf(address account) external view returns (uint256);
    function transfer(address recipient, uint256 amount) external returns (bool);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    function approve(address spender, uint256 amount) external returns (bool);
    function allowance(address owner, address spender) external view returns (uint256);
}

contract TokenBank{

    IERC20 public token;

    mapping (address => uint256) public deposits;

    event Deposit(address indexed user, uint256 amount);
    event Withdraw(address indexed user, uint256 amount);

    constructor(address _owner){
        require(_owner != address(0), "token address can not be zero");
        token =IERC20(_owner);
    }

    function deposit(uint256 _amount)external {
        require(_amount > 0, "amount must more than 0");

        require(token.balanceOf(msg.sender) >= _amount, "insuficient token balance");

        bool success = token.transferFrom(msg.sender, address(this), _amount);

        require(success, "deposit failed");
        deposits[msg.sender] += _amount;

        emit Deposit(msg.sender, _amount);
    }

    function withdraw(uint256 _amount)external {
        require(_amount > 0, "amount must greater zero");

        require(deposits[msg.sender] >= _amount, "insufficient tokan balance");

        deposits[msg.sender] -= _amount;
        bool success = token.transfer(msg.sender, _amount);
        require(success, "withdraw failed");

        emit Withdraw(msg.sender, _amount);
    }

    function balanceOf(address _user)public view returns(uint256){
        return deposits[_user];
    }


}

contracts/BaseERC20.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract BaseERC20{
    string public name;
    string public symbol;
    uint8 public decimals;

    uint256 public totalSuppply;

    mapping (address => uint256) balances;

    mapping (address => mapping (address => uint256)) allowances;

    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);

    constructor(){
        name ="MyToken";
        symbol="MTK";
        decimals=18;
        totalSuppply=10000000*10**decimals;
        balances[msg.sender] = totalSuppply;
    }

    function balanceOf(address _owner)public view returns (uint256 balance){
        return balances[_owner];
    }

    function transfer(address _to, uint256 _value) public returns (bool success){
        require(_to != address(0), "transfer to zero address");
        require(balances[msg.sender] >= _value, "transfer amount exceeds balance");

        balances[msg.sender] -= _value;
        balances[_to] +=_value;

        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value)public returns (bool success){
        require(_from != address(0), "transfer from zero address");
        require(_to != address(0), "transfer to zero address");
        require(balances[_from] >= _value, "transfer amount exceeds balance");
        require(allowances[_from][msg.sender] >= _value, "transfer amount exceeds balance");

        balances[_from] -= _value;
        balances[_to] += _value;

        allowances[_from][msg.sender] -= _value;
        emit Transfer(_from, _to, _value);
        return true;

    }


    function approve(address _spender, uint256 _value)public returns (bool success){
        allowances[msg.sender][_spender] = _value;
        emit Approval(msg.sender, _spender, _value);
        return true;
    }

    function allowance(address _owner,address _spender)public view returns (uint256 remaining){
        return allowances[_owner][_spender];
    }
}

